class Solution(object):
    def removeStars(self, s):
        """
        :type s: str
        :rtype: str
        """
        # i=0
        # while i<len(s):
        #     if s[i]=="*":
        #         s=s[0:i-1]+s[i+1:]
        #         i-=1
        #     else:
        #         i+=1
        # return s
        # s=list(s)
        # while True:
        #     if "*" in s:
        #         i=s.index("*")
        #         del s[i]
        #         del s[i-1]
        #     else:
        #         break
        # return "".join(s)
        stack=[]
        for char in s:
            if char=="*":
                stack.pop()
            else:
                stack.append(char)
        return "".join(stack)
